\">Respuestas Sugeridas</span>, escríbeme o háblame con el botón de micrófono. <br> ¿Cómo puedo ayudarte hoy?','dar bienvenida','retorno','','2025-09-11 19:28:11'),(4667,294,'User','¿Cuál es el costo del servicio?','Con un solo pago, obtienes instalación, 12 meses de plataforma, garantía ilimitada, soporte, visitas, central CYVER y protocolo anti-robo, sin cargos ocultos ni mensualidades. Desde el segundo año, pagas menos y mantienes todos los beneficios.','responder proceso','retorno','costo,servicio','2025-09-11 19:28:35'),(4668,294,'User','¿Qué incluye la instalación?','La instalación incluye el equipo, configuración y puesta en marcha del servicio en tus unidades.','responder proceso','retorno','incluye,instalacion','2025-09-11 19:30:16'),(4669,294,'User','¿Cómo se actualiza la información en la plataforma?','Lo siento. Solo respondemos preguntas relacionadas con nuestros servicios de rastreo GPS. Aquí tengo unos temas con los que podemos continuar.','responder proceso','retorno','actualiza,informacion,plataforma','2025-09-11 19:30:59'),(4670,294,'User','Por eso ¿Cómo se actualiza la información en la plataforma de rastreo?','Lo siento. Solo respondemos preguntas relacionadas con nuestros servicios de rastreo GPS. Aquí tengo unos temas con los que podemos continuar.','responder proceso','retorno','actualiza,informacion,plataforma,rastreo','2025-09-11 19:32:48'),(4671,294,'User','Cómo se actualiza la información del gps en la plataforma de rastreo?','La información del GPS se actualiza en tiempo real en nuestra plataforma de rastreo. Puedes ver la ubicación y datos de tus unidades al instante.<br><br><video controls controlslist=\"nodownload\"> <source src=\"/static/videos/machin-v3-bienvenida-app-c.mp4\" type=\"video/mp4\"> Tu navegador no soporta el video. </video><br>','responder proceso','retorno','actualiza,informacion,gps,plataforma,rastreo','2025-09-11 19:33:52'),(4672,294,'User','¿El GPS funciona sin señal celular?','Sí, el GPS funciona mediante satélites