l\"','2025-04-02 17:16:28'),(301,NULL,'que hace tan especial a gpscontrol','Beneficios y Diferenciadores','Conocer ventajas del servicio','que hace, tan, especial, gpscontrol','GPScontrol ofrece tecnología avanzada, soporte personalizado, aplicación móvil y una plataforma con una interfaz intuitiva que optimiza la gestión de Flotas, mejorando la eficiencia y reduciendo costos.','¿Te gustaría conocer más sobre nuestros beneficios?','\"Beneficios de estar con GPScontrol, Requiero información de servicios, Soluciones para Rastreo Empresarial, Quiero una cotización\"','2025-04-12 03:27:23'),(302,NULL,'tiene boton de panico','Accesorios','Consultar accesorios adicionales','tener,boton,panico','Sí, nuestros dispositivos cuentan con un botón de pánico que permite enviar alertas de emergencia en tiempo real.','¿Te gustaría saber más sobre nuestras soluciones de rastreo?','\"Soluciones de rastreo, Soluciones para Rastreo Empresarial, Quiero una cotización\"','2025-05-09 23:35:09');
