52:52'),(526,'¿Se pueden definir rutas y recibir alertas de desvío?','','sin clasificar','solicitar cotizacion','Sí, puedes definir rutas y recibir alertas de desvío.','2025-09-11 19:54:07'),(527,'¿Cuántos usuarios pueden tener acceso a la plataforma?','','sin clasificar','consultar información','La plataforma permite múltiples usuarios, dependiendo del plan contratado.','2025-09-11 19:54:54'),(528,'¿Hay app móvil y para qué sistemas operativos está disponible?','','sin clasificar','consultar información','Sí, tenemos una app móvil disponible para iOS y Android.${video}','2025-09-11 19:56:57'),(529,'¿Ofrecen financiamiento o planes a meses?','','sin clasificar','solicitar cotizacion','Sí, ofrecemos opciones de financiamiento.','2025-09-11 19:58:15'),(530,'¿Qué pasa si vendo mi auto con el GPS instalado?','','sin clasificar','consultar información','El GPS se puede transferir al nuevo propietario o desinstalarlo. Es importante notificar a GPScontrol para actualizar la información.','2025-09-11 20:04:08'),(531,'¿El equipo afecta la garantía del vehículo?','','sin clasificar','consultar información','No, el equipo no afecta la garantía del vehículo. Se instala de manera que no interfiera con la garantía.','2025-09-11 20:05:39'),(532,'¿Puedo mover mi GPS a otro vehículo?','','sin clasificar','consultar información','Sí, puedes mover tu GPS a otro vehículo. Solo necesitas realizar la reprogramación correspondiente.','2025-09-11 20:06:21'),(533,'¿Ofrecen pruebas del sistema antes de contratar?','','sin clasificar','consultar información','Sí, ofrecemos pruebas del sistema.','2025-09-11 20:07:02'),(534,'¿Cómo contacto al soporte técnico?','','sin clasificar','consultar información','Puedes contactar al soporte técnico al correo soporte@gpscontrol.com.mx o al teléfono 5593311360 opción 3.','2025-09-11 20:08:39'),(535,'¿Qué diferencia tienen frente a otras marcas de rastreo?','','sin clasificar','consultar información','Contamos con tecnología avanzada, atención personalizad